import React, { Component } from 'react';
// import logo from './assets/logo.png';
import slack from './assets/slack.svg';
import meetup from './assets/meetup.png';
import calendar from './assets/calendar3.svg';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
          {/* <img src={logo} className="logo" alt="Dev London logo" /> */}
          {/* <p>Bringing the Forest City tech community together.</p> */}
          <h1>Bringing tech <span className="pop">together</span><br />in the <span className="pop">Forest City</span></h1>
          <div className="action-container">
            <button className="call-to-action slack shadow">
              <img src={slack} className="slack-img shadow" alt="Slack logo" />
              Join the community
            </button>
            <button className="call-to-action meetup shadow">
              <img src={meetup} className="meetup-img shadow" alt="Meetup logo" />
              Come to an event
            </button>
          </div>
        </header>
        <div className="info">
          <div className="section">
            <div className="icon"><img src={calendar} alt="Calendar icon" /></div>
            <div className="title">title</div>
            <div className="caption">caption</div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
